import React from "react";
import NavBar from "../ui/NavBar";
import scholarships from "./data";

const styles = {
    container: {
        margin: "20px",
        fontFamily: "Arial, sans-serif"
    },
    searchBar: {
        display: "flex",
        justifyContent: "space-between",
        marginBottom: "20px"
    },
    searchInput: {
        flex: 1,
        padding: "10px",
        fontSize: "16px",
        border: "1px solid #ddd",
        borderRadius: "4px"
    },
    sortButton: {
        marginLeft: "10px",
        padding: "10px 20px",
        fontSize: "16px",
        backgroundColor: "#007bff",
        color: "white",
        border: "none",
        borderRadius: "4px",
        cursor: "pointer"
    },
    sortButtonHover: {
        backgroundColor: "#0056b3"
    },
    table: {
        width: "100%",
        borderCollapse: "collapse"
    },
    thTd: {
        border: "1px solid #ddd",
        textAlign: "left",
        padding: "8px"
    },
    th: {
        backgroundColor: "#f2f2f2"
    },
    infoButton: {
        backgroundColor: "#4CAF50",
        color: "white",
        border: "none",
        padding: "5px 10px",
        textAlign: "center",
        textDecoration: "none",
        display: "inline-block",
        fontSize: "14px",
        margin: "4px 2px",
        cursor: "pointer",
        borderRadius: "4px"
    },
    infoButtonHover: {
        backgroundColor: "#45a049"
    },
    pagination: {
        marginTop: "20px",
        textAlign: "center"
    },
    paginationSpan: {
        cursor: "pointer",
        padding: "8px 16px",
        textDecoration: "none",
        color: "#007bff"
    },
    paginationSpanHover: {
        textDecoration: "underline"
    }
};

function EntireScholar(props) {
    return (
        <>
            <NavBar/>
        </>
    );

}
export default EntireScholar;
